import React from "react";
import ReactDom from "react-dom";
import { BrowserRouter, Route, Link } from "react-router-dom";

// import Main from "./Main";

// import "./index.css";

const App = () => {
  return (
    <div id="app">
      <header>
        <Link to="/home">
          <button class="btn" id="home">
            Home
          </button>
        </Link>
        <Link to="/routines">
          <button class="btn" id="routines">
            {" "}
            Routines
          </button>
        </Link>
        <Route exact path="/home">
          <h1>Welcome to Home</h1>
        </Route>
        <Route path="/routines">
          <h1>Welcome to Routines</h1>
        </Route>
        <Route path="/myroutines">
          <h1>Welcome to My Routines</h1>
        </Route>
        <Route path="/activities">
          <h1>Welcome to Activities</h1>
        </Route>
        <Route path="/account">
          <h1>Welcome to Account</h1>
        </Route>
      </header>
    </div>
  );
};

ReactDom.render(
  <BrowserRouter>
    <React.StrictMode>
      <App />
    </React.StrictMode>
  </BrowserRouter>,
  document.getElementById("app")
);
